  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Cold Bay Management
  Area covers accomplishments from October to December 1948. The report begins by
  summarizing the weather conditions during this period. Wildlife- including migratory
  birds, upland game birds, big game animals, furbearers, predators, rodents, and
  mammals- is also covered. Resource management is outlined; topics include fur harvesting.
  The public relations section of the report describes recreational uses, Refuge visitors,
  and hunting. Items of interest are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
